import React from 'react';
import 'bulma/css/bulma.css';
import _ from 'underscore'

const App = () => {
  const array = [1, 2, 3]
  const makeArray = () => {
    let newArray = [1, 2, 3, 4, 5, 6, 7, 8, 9, 50]

    return _.sample( newArray, 4 ).toString()
  }
  const anotherArray = () => {
    let newArray = _.filter([1, 2, 3, 4, 5, 6, 8, 8], (num) => {
      return num % 2 === 0
    })
    return newArray.toString()
  }
  return (
    <div className="">
      Our random number : {makeArray()}
      our new array : {anotherArray()}

    </div>

  );
}

export default App;
